import React from 'react';
import './styles/Header.css';
import pic from '../assets/pic.jpg';

function Header() {
  return (
    <header className="header">
      <img src="/assets/pic.jpg" alt="Deepak Raj" className="profile-picture" />

      {/* <img src="./assets/pic.jpg" alt="Deepak Raj" className="profile-picture" /> */}
      <h1>Deepak Raj</h1>
      <p className="tags"><b>Developer</b> || <b>Traveller</b></p>
    </header>
  );
}

export default Header;
